No conozco la continuación completa de este poema. El fragmento que me has mostrado es el primer cuarteto de un soneto satírico, escrito en octava real, donde el autor (probablemente Quevedo) responde de manera irónica a una crítica. Sin embargo, no puedo completar el resto del poema con precisión.
